import React from 'react';
import temple from '../../img/museum.png'

const middleStyle = {
    fontSize: "48px",
    paddingLeft: 420,
    backgroundColor: '#d76843',
    backgroundImage: `url(${temple})`,
    backgroundRepeat: 'no-repeat',
    backgroundPosition: '350px',
    minHeight: '410px',
}

const sectionOne = {
    fontSize: "10px",
    paddingTop: "100px",
}

const sectionTwo = {
    fontSize: "20px",
    paddingTop: "100px",

}

const sectionThree = {
    fontSize: "20px",
    paddingTop: "100px",

}

const sectionFour = {
    fontSize: "20px",
    paddingTop: "100px",

}

function Section(props) {
    return (
        <div style={props.section}>{props.text}</div>
    )
}

export default function Middle() {
    return (
        <div style={middleStyle}>
            <Section section={sectionOneStyle} text={"sectionOneStyle"}></Section>
        </div>
    );
}
